const canvas = document.getElementById('canvas1');
// instance of canvas 2d api object
const ctx = canvas.getContext('2d')
// los valores deben ser los mismos definidos en css para el correcto escalado
canvas.width = 1020;
canvas.height = 576;
// blank new image  object
const image1 = new Image()
//image1.src= 'tmg.png'
image1.src = 'data:image/png;base64,'

//when image is fully loaded excecute the callback
image1.addEventListener('load', () => {
    //draw image, arguments --> image, x corordinate, y coordinate, width, height
    ctx.drawImage(image1, 0, 0);
    //pixel imfo 4 arguments --> x, y, end coordonates x, end coord y 
    //scans all pixels left to rigth row by row top to bottom
    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height)
   
    //some browsers due to cross-origin resource sharing you will get an error 
    //to solve you can convert any image into data string and place that string directly into your file 
    //using toDataURL() or png to base 64 on google
    //contains an array of the colors of all the pixels of the image rgba (red, green, blue, opacity)
    console.log(scannedImage)

    const scannedData = scannedImage.data
    // i += 4 becouse a pixel es conformed by the 4 values
    for (let i = 0; i < scannedData.length; i += 4){
        // si se asigna el mismo valor a rgb se obtine un tono gris
        const total = scannedData[i] + scannedData[i+1] + scannedData[i+2];
        const averageColorValue = total/3;
        scannedData[i] = averageColorValue;
        scannedData[i + 1] = averageColorValue;
        scannedData[i + 2] = averageColorValue;
    }
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage, 0, 0);
     
} )